    <!-- <circle cx="50vw" cy="50vh" r="100" /> -->
    <div class="overflow-hidden d-none">
      <div class="overflow-hidden" id="cursor"></div>
    </div>
  </div>
</template>

<script>
import Warp from '~/assets/js/warp.js'

export default {
  setup() {},

  async mounted() {
    let brushSize = 70
    var earthXOrigin, earthYOrigin
    if (!this.isMobile()) {
      earthXOrigin = window.innerWidth / 2 - 375
      earthYOrigin = window.innerHeight / 2 - 200
    } else {
      earthXOrigin = 0
      earthYOrigin = 100
    }

    this.earthx = earthXOrigin
    this.earthy = earthYOrigin

    const svg = document.getElementById('svg-element')
    // const cursor = document.getElementById('cursor')
    const warp = new Warp(svg)

    const svgPos = svg.getBoundingClientRect()
    const originX = svgPos.left
    const originY = svgPos.top
    console.log(originX)

    let pointCount = 0
    let smudging = true
    let mouseX = 0
    let mouseY = 0
    let lastMouseX = 0
    let lastMouseY = 0
    let mouseDeltaX = 0
    let mouseDeltaY = 0

    // window.addEventListener('mousedown', e => smudging = true)
    // window.addEventListener('mouseup', e => smudging = false)

    window.addEventListener(
      'touchmove',
      function (e) {
        mouseX = e.touches[0].clientX - earthXOrigin
        mouseY = e.touches[0].clientY - earthYOrigin
        mouseDeltaX = mouseX - lastMouseX
        mouseDeltaY = mouseY - lastMouseY
        lastMouseX = mouseX
        lastMouseY = mouseY
      },
      false
    )

    window.addEventListener('mousemove', function (e) {
      mouseX = e.clientX - earthXOrigin
      mouseY = e.clientY - earthYOrigin
      mouseDeltaX = mouseX - lastMouseX
      mouseDeltaY = mouseY - lastMouseY
      lastMouseX = mouseX
      lastMouseY = mouseY
    })
    function smudge([x, y]) {
      const pointX = x + originX
      const pointY = y + originY
      const deltaX = mouseX - pointX
      const deltaY = mouseY - pointY
      const delta = Math.sqrt(deltaX ** 2 + deltaY ** 2)

      if (delta <= brushSize) {
        x += mouseDeltaX * ((brushSize - delta) / brushSize)
        y += mouseDeltaY * ((brushSize - delta) / brushSize)
      }

      return [x, y]
    }

    function update() {
      // cursor.style.transform = `translate(${mouseX}px, ${mouseY}px)`
      // cursor.style.fontSize = `${brushSize}px`

      if (smudging) {
        if (pointCount < 4000) {
          // warp.preInterpolate(smudge, 8)
          warp.interpolate(8)
        }

        pointCount = 0
        warp.transform(function (points) {
          pointCount++
          return smudge(points)
        })

        mouseDeltaX = lastMouseX === mouseX ? 0 : mouseDeltaX
        mouseDeltaY = lastMouseY === mouseY ? 0 : mouseDeltaY
      }

      requestAnimationFrame(update)
    }

    update()
  },
  created() {
    if (process.client) {
      this.earthx = window.innerWidth

      // ... mobile { ... styles }
      // ... desktop { ... styles }

      // ... if width is less than 700, return mobile
      // ... if width greater than 700, return desktop
    }
  },
  computed: {},
  data() {
    return {
      earthx: null,
      earthy: null,
    }
  },
  methods: {
    isMobile() {
      if (process.client) {
        const width = window.innerWidth
        if (width > 700) {
          return false
        } else {
          return true
        }
      }
    },
    handleTouch(e) {
      this.preventDefault
      this.mouseX = this.clientX - this.earthXOrigin
      this.mouseY = this.clientY - this.earthYOrigin
      this.mouseDeltaX = this.mouseX - this.lastMouseX
      this.mouseDeltaY = this.mouseY - this.lastMouseY
      this.lastMouseX = this.mouseX
      this.lastMouseY = this.mouseY
    },
  },
}
</script>